findings:
[{'explanation': 'Deloitte, a prominent consultancy firm, has been significantly impacted by the misuse of generative AI by their new graduate intakes. The firm had to take the drastic step of firing most of these new hires due to dishonest use of the technology. This incident highlights the challenges and risks associated with the adoption of advanced AI technologies in professional settings. The reputational damage and operational disruptions caused by this event are substantial [Data: Entities (566); Relationships (3189)].', 'summary': "Deloitte's involvement with generative AI"}
